// frontend/src/components/CameraFeed.js
import React, { useEffect, useRef, useState } from 'react';
import { Camera, Pause, Play } from 'lucide-react';

const CameraFeed = ({ currentStep, onAnalysisComplete }) => {
  const videoRef = useRef(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [autoMode, setAutoMode] = useState(false);
  const [lastAnalysis, setLastAnalysis] = useState(null);
  const analyzeIntervalRef = useRef(null);

  useEffect(() => {
    startCamera();
    return () => {
      stopCamera();
      stopAutoAnalysis();
    };
  }, []);

  const startCamera = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({ 
        video: { 
          facingMode: 'environment',  // Prefer back camera
          width: { ideal: 1280 },
          height: { ideal: 720 }
        } 
      });
      videoRef.current.srcObject = stream;
    } catch (error) {
      console.error('Error accessing camera:', error);
    }
  };

  const stopCamera = () => {
    const stream = videoRef.current?.srcObject;
    stream?.getTracks().forEach(track => track.stop());
  };

  const captureFrame = () => {
    const video = videoRef.current;
    const canvas = document.createElement('canvas');
    canvas.width = video.videoWidth;
    canvas.height = video.videoHeight;
    const context = canvas.getContext('2d');
    context.drawImage(video, 0, 0, canvas.width, canvas.height);
    return canvas.toDataURL('image/jpeg', 0.8); // Compress to 80% quality
  };

  const analyzeFrame = async () => {
    if (isAnalyzing) return;

    setIsAnalyzing(true);
    try {
      const imageData = captureFrame();

      // Don't analyze if the image is too similar to last analysis
      if (imageData === lastAnalysis) {
        return;
      }

      const response = await fetch('/api/assembly/gemini/validate', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          image: imageData,
          currentStep
        })
      });

      if (!response.ok) throw new Error('Analysis failed');

      const result = await response.json();
      setLastAnalysis(imageData);
      onAnalysisComplete(result);

    } catch (error) {
      console.error('Analysis error:', error);
    } finally {
      setIsAnalyzing(false);
    }
  };

  const toggleAutoMode = () => {
    if (!autoMode) {
      // Start auto-analysis every 5 seconds
      setAutoMode(true);
      analyzeIntervalRef.current = setInterval(analyzeFrame, 5000);
    } else {
      stopAutoAnalysis();
    }
  };

  const stopAutoAnalysis = () => {
    setAutoMode(false);
    if (analyzeIntervalRef.current) {
      clearInterval(analyzeIntervalRef.current);
      analyzeIntervalRef.current = null;
    }
  };

  return (
    <div className="bg-black/30 backdrop-blur-sm rounded-2xl p-4 border border-white/10">
      <div className="aspect-video bg-black/40 rounded-xl overflow-hidden relative">
        <video 
          ref={videoRef} 
          className="w-full h-full object-cover" 
          autoPlay 
          playsInline 
          muted 
        />
        {isAnalyzing && (
          <div className="absolute inset-0 bg-black/50 flex items-center justify-center">
            <div className="text-white">Analyzing...</div>
          </div>
        )}
      </div>
      <div className="mt-4 flex justify-between items-center">
        <h2 className="text-lg font-semibold text-white">Live Assembly View</h2>
        <div className="flex gap-2">
          <button
            onClick={toggleAutoMode}
            className={`${
              autoMode ? 'bg-red-600' : 'bg-green-600'
            } hover:opacity-90 text-white px-4 py-2 rounded-lg transition-colors flex items-center gap-2`}
          >
            {autoMode ? <Pause className="w-4 h-4" /> : <Play className="w-4 h-4" />}
            {autoMode ? 'Stop Auto' : 'Start Auto'}
          </button>
          <button
            onClick={analyzeFrame}
            disabled={isAnalyzing || autoMode}
            className={`bg-purple-600 hover:bg-purple-700 text-white px-4 py-2 rounded-lg transition-colors flex items-center gap-2 ${
              (isAnalyzing || autoMode) ? 'opacity-50 cursor-not-allowed' : ''
            }`}
          >
            <Camera className="w-4 h-4" />
            Analyze
          </button>
        </div>
      </div>
    </div>
  );
};

export default CameraFeed;
